import React from "react";

function NavBar() {
  return (
    <div>
      <div className="relative">
        <nav className="bg-cyan-400 fixed top-0 h-16 ">
          <a
            href=""
            className="navbar-brand col-sm-3 col-md-2 mr-0 align-items-center"
          ></a>
        </nav>
      </div>
    </div>
  );
}
export default NavBar;
